export class Model {
    items;
   
    constructor() {
       this.items = [
         new TodoItem("Kahvaltı", Yes),
         new TodoItem("Kod", No),
         new TodoItem("Gitar", No),
         new TodoItem("Ders",No),
       ];
    }
   }
   
   export class TodoItem {
    description:string;
    action:string;
   
    constructor(description:string, action:string) {
       this.description = description;
       this.action = action;
    }
   }
